import React from 'react'
import { useTypewriter } from 'react-simple-typewriter'
function Hero() {
    const [text,count] = useTypewriter({
     words:   ["Your dream is our care"],

     delaySpeed: 2000
    })
  return (
    <div>
    <p className='font-custom'>{text}</p>
    </div>
  )
}

export default Hero
